      "facts": [
        {
          "title": "*",
          "value": "Gather valuable feedback from your teammates directly in Microsoft Teams"
        },
        {
          "title": "*",
          "value": "Provide powerful questions, quizzes, and feedback directly in meetings"
        },
        {
          "title": "*",
          "value": "Add Polly as a tab to explore results and manage pollys"
        }
      ],
      "type": "FactSet"
    }
